import React from "react";
import { UserItem } from './Follow'; // Adjust the import path based on your project structure

const Profile = (props) => {
  const { avatarUrl, username, tweets, follower, following } = props;

  const userList = [
    {
      id: 1,
      username: 'a.lover',
      name: 'akshay neje'
    },
    {
      id: 2,
      username: 'onkar',
      name: 'onkar kadam'
    },
    {
      id: 3,
      username: 'praju',
      name: 'prajakta mali'
    }
  ];

  return (
    <div>
      <div className="flex items-center">
        <div id="profile" className="w-98">
          <img
            src={avatarUrl}
            alt={username}
            className="h-12 w-16 rounded-full object-cover mr-4"
          />
        </div>
        <div id="my-tweets">
          <p>{tweets}</p>
          <p>Tweets</p>
        </div>
        <div id="follower">
          <p>{follower}</p>
          <p>Followers</p>
        </div>
        <div id="following">
          <p>{following}</p>
          <p>Following</p>
        </div>
      </div>
      <div id="list">
        {userList.map((element) => (
          <UserItem key={element.id} userDetails={element} />
        ))}
      </div>
    </div>
  );
};

export { Profile };
